INSERT INTO `kemu` VALUES ('2018DLE015', 'EPC', '将军山', '杨朝许', '269.90 ', '1699 ', '15.89%', '平顶山市金汇达电力工程有限公司', '', '施工', '项', '1', '167.500115 ', '167.500115 ', '2018.6.27', '83.000000 ', '133.250035 ', '34.250080 ', '79.55%', '集电线路：6.10    A线基础土石方部分完成；2018.5.20——6.10    A线PA24—PA25电缆沟完成；2018.5.20——6.20    PZA1—5#风机—8#风机电缆沟完成；2018.5.10——7.10    B线基础石方部分完成；升压站：2018.5.20    所有设备基础及接地敷设完成；', '', '', '', '预付30%；双方约定的进度款支付的方式和时间：工程进度款付至工程总造价的80%时截止，本工程竣工3个月后支付至合同总价90%，剩余部分待工程结算验收合格三个月内付至合同结算价95%（5%的质保金在缺陷责任期结束后结算退还）。付款到合同总额的80%时需提供本工程各类发票，发票额为100%；质量金保修金额为合同价款的5%，工程质保期满后28天内，由发包人组织验收，验收合格后，由发包人开具质保金支付证书，发包人支付承包人全部质保金。', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '50.250035', '83', '', '', '', '', '', '', '', '', '', '', '', 579, '吕小冉', '13937569918', '2193376', '平顶山市卫东区矿工路', '平顶山市市郊农村信用合作联社（原名：平顶山市市郊农村信用合作联社鹰城信用社）', '0000 0056 1415 1121 3012');
